import { useState } from "react";

// import components
// utils
import { Button1 } from "../../utils/buttons";
import { Input1, Input3 } from "../../utils/inputs";
import { Navlink2 } from "../../utils/links.js";
import PrivateRoute from "../../utils/PrivateRoute.js";

const CreateBlog = () => {
  const [formData, setFormData] = useState({
    bulletpoints: "",
    image: "",
    title: "",
  });

  const handleSubmit = (e) => {
    e.preventDefault();
  };

  const content = (
    <>
      <form onSubmit={handleSubmit}>
        <Input1 label="title" />
        <Input1 label="bulletpoints" />
        <Input3 label="image" />
        <Button1 text="SUBMIT" />
      </form>
      <Navlink2 colour="#d0491e" text="&#9756; return to dashboard" />
    </>
  );

  return <PrivateRoute content={content} title="Add Skill" />;
};

export default CreateBlog;
